import React, {useContext} from 'react'
import {ThemeContext} from '../ThemeContext'

function Paragrapth() {
    const context =  useContext(ThemeContext)
    return (
        <div className={context.theme}>
            Welcome to my Paragrapth 
        </div>
    )
}

export default Paragrapth
